import React from "react";
import {Link} from "react-router-dom";

function Nav() {
  return (
    <div>
        <ul>
            <li><Link to="/nomade">Home</Link></li>
            <li><Link to="/nomade/about">About</Link></li>
        </ul>
    </div> 
    
  );
}

export default Nav;
